import React from 'react';
import headshot from '../assets/headshot.JPG'; // Import your headshot image

const Profile = () => {
    return (
            <div style={styles.profileSection}>
                {/* Profile Image */}
                <img src={headshot} alt="Profile" style={styles.image} />

                {/* Text Section */}
                <div style={styles.textSection}>
                    {/* Hello with Line */}
                    <div style={styles.helloSection}>
                        <span style={styles.helloText}>Hello,</span>
                        <div style={styles.line}></div>
                    </div>

                    {/* Large Text */}
                    <p style={styles.bodyText}>
                        I'm Chase, a sophomore at NYU studying Mathematics and Computer Science. Scroll down
                    </p>
                </div>
            </div>
    );
};

const styles = {
    profileSection: {
        display: 'flex',
        alignItems: 'center',
        paddingLeft: '50px',
        paddingRight: '50px',
    },
    image: {
        width: '150px', // Set a fixed size for the image
        height: '300px',
        marginRight: '50px', // Space between the image and text
    },
    textSection: {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
    },
    helloSection: {
        display: 'flex',
        alignItems: 'center',
        marginBottom: '20px',
    },
    helloText: {
        fontSize: '1.5rem',
        fontWeight: 'bold',
        color: '#333',
        marginRight: '10px',
    },
    line: {
        flex: 1,
        height: '2px',
        backgroundColor: '#333',
    },
    bodyText: {
        fontSize: '1.5rem',
        color: '#333',
    },
};

export default Profile;
